import { Component } from "react";


class Filters extends Component {
  constructor() {
    super();
    this.state = {
      name: "React"
    };
    this.onChangeValue = this.onChangeValue.bind(this);
  }

  onChangeValue(event) {
    console.log(event.target.value);
  }

  render() {
    return (
      <div onChange={this.onChangeValue}>
        <input type="radio" value="videographer" name="type" onChange={this.handleChange } /> Videographer
        <input type="radio" value="photographer" name="type" onChange={this.handleChange} /> Photographer
      </div>
    );
  }
}

export default Filters;
